import React from "react";
import app from "./base";

const Home = () => {
  return (
    <>
   <DashboardLayout>
      <h2>Home Page</h2>
    </DashboardLayout>
      <button onClick={() => app.auth().signOut()}>Sign out</button>
    </>
  );
};

export default Home;
